import React from 'react'
import { Link } from 'react-router-dom'
import { dataPage } from '../../data'

export default function Product() {
  return (
    <ul>
      {
        dataPage.map((item, index)=>(
          <li><Link to = "/">{item}</Link></li>
        ))
      }
    </ul>
  )
}
